item.description:
Штатив Tripod SA-3888 - переносной штатив для фотокамеры с держателем для телефона и пультом Bluetooth.

Съемная штативная головка с ручкой для вращения камеры позволит быстро закрепить камеру в нужном положении, а съемная площадка - легко и удобно снять камеру со штатива и перейти на съемку с рук.

Головка штатива может вращаться на 360 градусов, что актуально для пейзажной, панорамной и т.п. съемки.

Особенности:

- Небольшой вес и малые габариты в сложенном состоянии;

- Нескользящие резиновые накладки на ножках;

- Головка со стандартным креплением, уровнем, поворотная на 360 ° по горизонтали, 90 ° по вертикали;

- Bluetooth пульт;

- Встроенный пузырьковый уровень;

- Ручка для регулировки положения головки.

Характеристики:

- Материал: алюминий/пластик;

- Цвет: черный, серый;

- Вес штатива: 350 гр;

- Винт под штативное гнездо камеры: 1/4;

- Макс. высота: 102 см;

- Мин. высота: 34.5 см;

- Длина в сложенном состоянии: 35 см.

В комплекте: штатив, крепление для телефона, пульт Bluetooth.
